window.bookSummaryJSON = "<p>From her first step onto Canderfey University's campus, Joanna Wick, the new librarian-in-training, is overwhelmed by the bustle of people and the wealth of magical information now available to her. Most overwhelming of all, she attracts the attention of three handsome professors. But Aiden King, Callum Pike, and Isaac Metclaffe are a coven waiting to find their fourth and complete their home, and Joanna knows she can't be that witch. She's barely magical.</p> <p>Aiden has been waiting 20 years to complete his coven. Callum doesn't want to disappoint his covenmates by turning down another potential fourth. Isaac has found a home with them both and only wants the best for his lovers. Have they found what they've all been waiting for in the skittish new hire at the university library?</p> <p><i>Contains mature themes.</i></p>"; 
